I honestly didnt expect this game to get a physical release. GameStop exclusive for now, Trine Series 1-3 that i bought "new" had already been opened and then had a make shift store seal put in place of the shrink wrap. 🎮
I really wish gamestop wouldn't do this. Its frustrating buying a new game at full price, only to find out that it had been opened.
🛡🗡🎮 I keep some of my stuff sealed, but as a consumer, I'd like make that choice, not have it already made for me. Dont you? 🤦‍♂️🤘🎮🤘
